import React from "react";
import "../About/about.css";
import dotImg from "../Assests/h1-bg.png";
function About() {
  return (
    <>
      <div className="aboutme">
        <div className="txt">
          <h1>
            a little <span> about </span>me
          </h1>
          <img src={dotImg} alt="img" />
          <p>
            We are a team of tech enthusiasts with expertise in HTML, CSS,
            Bootstrap, and React.js. Recently graduated with a Bachelor's in
            Computer Applications (BCA), we bring fresh, innovative ideas to web
            development. Our focus is on creating responsive, user-friendly
            websites and applications that meet modern standards. Passionate
            about coding and continuous learning, we strive to deliver
            high-quality digital solutions.
          </p>
          <button>download CV</button>
        </div>
      </div>
    </>
  );
}

export default About;
